import React from 'react';

const AddOn = (props) => {
    const { details, onSelect } = props;
    return (
        <div>
        <button onClick={() => {onSelect(details)}}>
          {details['Add-On Name']}
        </button>
      </div>
    );
}

export default AddOn;
